import React from "react";

function Navbar() {
  return (
    <nav className="navbar navbar-expand-md fixed-top bg-white">
      <div className="container my-2 text-center">
        <a href="/" className="navbar-brand text-dark font-weight-bold">
          Hyderabad
        </a>
      </div>
    </nav>
  );
}

export default Navbar;
